import axios from "axios";
//  'https://www.googleapis.com/books/v1/volumes?q=baseball&key=[YOUR_API_KEY]' \

const KEY = process.env.REACT_APP_API_KEY;
const url = "https://googleapis.com/books/v1/";

export function getVolumes(query) {
  const request = `${url}volumes?q=${query}`;

  fetch(request, {
    method: "GET"
  })
    .then(response => response.json())
    .then(json => {
      let { items } = json;
      return items;
    });
}
